import React, { useState } from 'react';
import Login from './Login';
import Dashboard from './Dashboard';

const App = () => {
  const [token, setToken] = useState(null);

  return (
    <div>
      {!token ? <Login onLogin={setToken} /> : <Dashboard token={token} />}
    </div>
  );
};

export default App;
